                <ListGroupItem className="messageListItem">Jaysing</ListGroupItem>
                <ListGroupItem className="messageListItem">Siddhant</ListGroupItem>
                <ListGroupItem className="messageListItem">Kunal</ListGroupItem>
            </ListGroup>

            <Container className="messageBody">
                <span className="MessageReceived d-flex justify-content-start">
                    <span className="MessageReceived">jaysing here </span>
                    <span class="MessageReceivedTime d-flex justify-content-end">12:00</span> 
                </span>

                <span className="MessageSend d-flex justify-content-end">  is one the most important and in-demand

                    and ensures to resemble with the
                    standard of GATE 2022 exam. y</span>
            </Container>
        </Container>
    );
}

export default Message;
